```cpp
#include <iostream>
#include <fstream>
#include <string>

int main() {
    std::string filename;
    char searchChar;

    // Get file name from user
    std::cout << "Enter file name: ";
    std::cin >> filename;

    // Check if the file exists
    if (!std::ifstream(filename).good()) {
        std::cerr << "File does not exist." << std::endl;
        return 1;
    }

    // Get character to search for
    std::cout << "Enter character to search for: ";
    std::cin >> searchChar;

    int count = 0;

    std::ifstream fileStream(filename);
    if (fileStream.is_open()) {
        char c;
        while (fileStream.get(c)) {
            if (c == searchChar) {
                ++count;
            }
        }
        fileStream.close();
    } else {
        std::cerr << "Unable to open file." << std::endl;
        return 1;
    }

    std::cout << "The character '" << searchChar << "' appears " << count << " times in the file." << std::endl;

    return 0;
}
```

This program prompts the user to enter the file name and the character to search for. It then opens the file and reads it line by line. For each character, it checks if it matches the search character, and if so, increments the count. Finally, it outputs the total count.

Please note that this program assumes the input text file contains only one type of newline character (`\n`). If the text file contains different types of newline characters or no newlines at all (e.g., a binary file), you may need to adjust the reading logic accordingly.

